import React from 'react'
import Typography from '@mui/material/Typography';
import Tooltip from '@mui/material/Tooltip';
import DeleteIcon from '@mui/icons-material/Delete';
import IconButton from '@mui/material/IconButton';

export const Detail = (itemList, item) => {

    const Delete = (id) => {
        /* タスクを削除する */
        setItemList(itemList.filter((item) => item.id !== id));
    }

    return (
        <div className="detail">
            <ul className="coordX detailInput">
                <Typography>x</Typography>
                <input type="number" />
            </ul>
            <ul className="coordY detailInput">
                <Typography>y</Typography>
                <input type="number" />
            </ul>
            <ul className="coordZ detailInput">
                <Typography>z</Typography>
                <input type="number" />
            </ul>
            <ul className="angle detailInput">
                <Typography>角度</Typography>
                <input type="number"/>
            </ul>
            <ul>
                <Tooltip onClick={() => Delete(item.id)} title="Remove" className="deleteButton">
                    <IconButton>
                        <Typography><DeleteIcon /> Remove</Typography>
                    </IconButton>
                </Tooltip>
            </ul>
            
        </div>
    )
}
